import { GoogleMap, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useCallback, useRef } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center point set to Jharkhand level
const center = {
  lat: 23.6102,  // Latitude of Jharkhand
  lng: 85.2799,  // Longitude of Jharkhand
};

const zoomLevel = 6;  // Initial zoom level for a broader view

// Coordinates for the Jharkhand polygon
const jharkhandCoords = [
  { lat: 24.4366, lng: 84.2201 },  // Northern border
  { lat: 24.1851, lng: 85.0568 },  // Slightly south
  { lat: 23.9867, lng: 85.6182 },  // Mid-north
  { lat: 23.6255, lng: 86.4194 },  // North-east
  { lat: 23.1986, lng: 86.8941 },  // Eastern side
  { lat: 22.7767, lng: 86.6826 },  // South-east
  { lat: 22.3571, lng: 85.9870 },  // Southern border
  { lat: 22.2786, lng: 85.3999 },  // South-west
  { lat: 22.7027, lng: 84.8895 },  // West
  { lat: 23.1097, lng: 84.6137 },  // Mid-west
  { lat: 23.7197, lng: 84.4003 },  // North-west
  { lat: 24.0020, lng: 84.4666 },  // Closing the boundary
];

// Coordinates for the Ranchi polygon
const ranchiCoords = [
  { lat: 23.4555, lng: 85.1736 }, // Northern point
  { lat: 23.4449, lng: 85.2735 }, // Northeast point
  { lat: 23.3862, lng: 85.3496 }, // Eastern side
  { lat: 23.3537, lng: 85.4120 }, // Southeastern side
  { lat: 23.2882, lng: 85.4584 }, // Southern point
  { lat: 23.1963, lng: 85.3981 }, // Southwest point
  { lat: 23.1674, lng: 85.3399 }, // Western side
  { lat: 23.2415, lng: 85.2200 }, // Mid-western side
  { lat: 23.3215, lng: 85.1973 }, // Northwest point
  { lat: 23.3701, lng: 85.1464 }, // Northern side
  { lat: 23.4555, lng: 85.1736 }, // Closing the boundary
];

// Coordinates for the Dhanbad polygon
const dhanbadCoords = [
  { lat: 23.8542, lng: 86.6110 }, // North point
  { lat: 23.8111, lng: 86.7374 }, // North-East point
  { lat: 23.7472, lng: 86.8890 }, // East point
  { lat: 23.6067, lng: 86.9744 }, // South-East point
  { lat: 23.4159, lng: 86.8415 }, // South point
  { lat: 23.4999, lng: 86.7033 }, // South-West point
  { lat: 23.6591, lng: 86.5001 }, // West point
  { lat: 23.7912, lng: 86.5070 }, // North-West point
  { lat: 23.8542, lng: 86.6110 }, // Closing the boundary
];

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  const mapRef = useRef(null);  // Using useRef instead of state to store map instance

  // Save the map instance when loaded
  const onLoad = useCallback((mapInstance) => {
    console.log("Map loaded:", mapInstance);
    mapRef.current = mapInstance;  // Store map instance in ref
  }, []);

  // Zoom in and fit the polygon's bounds when clicked
  const handlePolygonClick = useCallback((polygonCoords) => {
    const map = mapRef.current;
    if (!map) {
      console.log("Map instance not available.");
      return;
    }

    console.log("Polygon clicked, zooming in...");

    const bounds = new window.google.maps.LatLngBounds();
    polygonCoords.forEach(coord => bounds.extend(coord));
    map.fitBounds(bounds);

    // Optional: Set a custom zoom level after fitting bounds
    const listener = window.google.maps.event.addListener(map, "idle", () => {
      if (map.getZoom() > 10) {
        map.setZoom(10);  // Set desired zoom level
      }
      window.google.maps.event.removeListener(listener); // Remove the listener after zooming
    });
  }, []);

  return isLoaded ? (
    <div style={{ position: 'relative' }}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={zoomLevel}
        onLoad={onLoad}
      >
        {/* Jharkhand Polygon */}
        <PolygonF
          paths={jharkhandCoords}
          options={{
            fillColor: '#00FF00',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Jharkhand polygon clicked");
            handlePolygonClick(jharkhandCoords);
          }} // Zoom into Jharkhand when clicked
        />

        {/* Ranchi Polygon */}
        <PolygonF
          paths={ranchiCoords}
          options={{
            fillColor: '#FF5733', // Different color for Ranchi
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Ranchi polygon clicked");
            handlePolygonClick(ranchiCoords);
          }} // Zoom into Ranchi when clicked
        />

        {/* Dhanbad Polygon */}
        <PolygonF
          paths={dhanbadCoords}
          options={{
            fillColor: '#FFD700', // Different color for Dhanbad (Golden)
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Dhanbad polygon clicked");
            handlePolygonClick(dhanbadCoords);
          }} // Zoom into Dhanbad when clicked
        />
      </GoogleMap>
    </div>
  ) : <></>;
};

export default MapComponent;
